import React, { useState } from 'react';
// import axios from 'axios';
import { useForm, Controller } from 'react-hook-form';
import '../static/css/appStyle.css';

import FormInputString from '../components/Form/FormInputString';
import FormStateSelecter from '../components/Form/FormStateSelecter';
import FormCitySelecter from '../components/Form/FormCitySelecter';

import { 
    Title, 
    RegisterForm
} from '../static/StyledComponents';

const App = props => {
    const { handleSubmit, control } = useForm();

    const [cities, setCities] = useState();

    return (
        <div>
            <Title>
                Cadastro de Empres√°rios
            </Title>
            <RegisterForm>
                <FormInputString title="Nome" />
                <FormInputString title="Celular" />
                <FormStateSelecter setCities={setCities} />
                <FormCitySelecter cities={cities} />
            </RegisterForm>
        </div>
    );
};

export default App;
